import React, {Component} from 'react';
import Aux from '../../hoc/Auxiliary';

class TodoAdder extends Component {
    render(){
        return(
            <Aux>
                <div>Todo list</div>
                <div>Todo controls</div>
            </Aux>
        );
    }
}

export default TodoAdder;
